		'Описание проекта': `<p>Хозяин квартиры из Италии, поэтому она предназначена для временного пребывания. Этим обусловлено полное отсутствие шкафов и небольшая кухня. Она имеет систему поворотно-сдвижных фасадов. Таким образом, в закрытом виде кухня становится полноценной частью гостиной. По просьбе хозяина, мы старались максимально избегать ярких тонов и не выходить за рамки монохромной гаммы. Другим его пожеланием было использование только локального и направленного освещения. В итоге, каждая зона приобрела свою атмосферу. Для этого проекта был специально разработан светильник Alpha and Omega (разные по диаметру круги на стене в гостиной, которые за счет своей подсветки сзади будто бы оторваны от стены и парят в воздухе. Они напоминают планеты на фоне градиентной стены (переход от глубоко-синего к серому символизирует глубины космоса). Освещение и цветовая гамма вместе образовали таинственную, космическую атмосферу.</p>`,
