		'Описание проекта': `<p>Дом спроектирован для небольшой семьи, но может принять большую компанию друзей. Сердцем дома можно назвать просторную двухсветную гостиную, объединенную с кухней и столовой. А одной из особенностей является консольная ее часть, парящая над участком. Заметной чертой дома является большая площадь остекления: П-образное панорамное остекление гостиной, непрерывное ленточное остекление под потолком части дома, остекление галереи на первом этаже с выходом на террасу и т.д. Это даёт ощущение неразрывной связи интерьера дома с окружающей его природой. <br />Участок расположен за городом, в живописном месте, окружённый большими соснами. Чтобы подчеркнуть единение дома с природой, проектом предусмотрено дерево, растущее прямо на террасе дома.<br />В отделке применены всего три материала, гармонично сочетающиеся друг с другом. Это клинкерный кирпич, крупноформатный керамогранит и деревянная рейка.</p>`,
