		'Год реализации': 2018,
		'Описание проекта': `<p>Конкурсный проект национального павильона Беларуси на всемирной выставке ЭКСПО-2020 в Дубае.</p>
<p>Концепция проекта состоит в том, чтобы совместить современные технологии и культурные особенности нашей страны. В основании павильона находится “поле” из колосьев, являющихся на наш взгляд айдентикой Беларуси. Они есть на нашем гербе, традиционно использовались в строительстве и народном искусстве, отражают характер Беларуси как аграрной страны. Динамичный куб, который находится над колосьями, символизирует технологии. Будучи правильной чистой формы, он монументально нависает над полем. Таким образом, мы четко видим иерархию в этом павильоне: технологическая часть находится над аграрной.<br />Сам куб имеет габариты 15х35х15 м. Это динамическая структура, состоящая из деревянных брусков квадратного сечения, выкрашенных в белый цвет. Бруски двигаются в горизонтальном положении, создавая объём и игру светотени. Таким образом, мы получаем возможность проецировать на фасад различные графические изображения. В качестве нашей основной идеи этого фасада, мы предлагаем проецировать схематичные шаржи известных белорусов. Это могут быть деятели культуры прошлого и современные люди, которые внесли вклад в развитие нашей страны. Внутри павильона должна быть установлена программа, которая преобразует в схематичные шаржи лица гостей, желающих, чтобы их шарж отобразился на фасаде. Концепция в том, чтобы отразить аллегорию: плодородная белорусская земля снизу, а над ней самое ценное, что есть у нашей страны – люди – белорусское общество. Возможность гостям павильона стать частью этого общества символизирует наше гостеприимство. Кроме схематичных портретов, на фасад павильона могут проектироваться простые символы белорусского народа, такие как василек, аист, соломенный конь и т.д.<br />Фасад также может отражать явления и события, происходящие в Беларуси в реальном времени (например, мы победили в хоккейном турнире и по нашему фасаду проносится хоккеист и играет гимн Беларуси) или в Минске ветреная погода, фасад начинает двигаться волнообразно.<br />Интересно, что при движении фасада меняется геометрия его внутреннего пространства (есть фиксированные габариты внутреннего пространства, и есть динамическая часть, которая при движении брусков вперёд может расширять внутреннее пространство примерно на 2 метра). У фасада может быть режим, при котором он движется в зависимости от того, как внутри ходят люди. Чем ближе человек подходит к наружной стене, тем ближе она выступает вперёд. Чем дальше отходит к “ядру павильона”, тем сильнее пространство сужается. Это символизирует здание, как живой организм, реагирующий на перемещение людей и подстраивающий своё внутреннее пространство под них. Мы думаем, что такие “живые здания” могут быть актуальны в будущем. Таким образом, динамичный фасад имеет множество режимов и различных способов взаимодействия с гостями. От визуальной информации до изменения внешних габаритов интерьера. Многообразие процессов требует написания сложного ПО. Мы хотели сделать акцент на том, что наша страна сильна не только в сельхоз-отрасли, но и имеет высококвалифицированных программистов, способных разрабатывать сложные компьютерные системы.<br />Путь ко входу проходит через “поле” колосьев высотой до двух метров. Человек проходит через небольшой лабиринт и попадает к лифту, вокруг он видит колосья, а над собой зеркальное основание павильона. Лифтовые шахты являются несущей конструкцией, они зеркальные, как и основание куба, что растворяет окружение и прячет несущую опору павильона. На первом этаже для посетителей расположен ресторан с белорусской кухней. На втором этаже - общий зал с небольшой экспозицией и переговорная комната.<br />Форма куба, в психологии человека ассоциируется с домом. В данном случае домом мы называем нашу страну. Проектом павильона мы постарались отразить её уникальность и многогранность.</p>`,
