		'Описание проекта': `<p>Одной из основных задач при проектировании этого дома стало решение пространственного размещения основных его помещений и функциональных зон. С учётом ориентации по сторонам света, и розе ветров – отражающей преимущественное направление ветра, были выбраны точки размещения кухни-гостиной и террасы. При расположении гаража – учитывалось пожелание заказчика – иметь крытый навес для машины. Для максимальной маскировки этого пространства – было принято решение организовать его за счёт консольного нависающего второго этажа. <br />В оформлении фасада преследовался минимализм и лаконичность, отделка первого этажа деревянными рейками контрастирует с светлым вторым этажом. Этажи разделены поясом ленточного остекления, что создаёт эффект парения консоли.</p>`,
