		'Год реализации': 2019,
		'Описание проекта': `<p>В 2019 году велась разработка нового туристического бренда Soligorsk города Солигорска, его спонсировал ОАО «Беларуськалий». Планировалось создание масштабного проекта, который призывает к популяризации туризма в Беларуси, и, в частности, делает из города Солигорск точку притяжения различный групп людей. В итоге ожидается, что Солигорск станет "столицей гостеприимства Беларуси".</p>
<p>Создание павильонов будет первоначальным этапом запуска бренда Soligorsk, в дальнейшем планируется создание выставочных стендов разной степени сложности, создание архитектурной набережной, с рекреационной зоной (водные виды отдыха), сувенирными магазинами и улицей ресторанов и кафе.</p>
<p>За разработку и создание бренда Soligorsk, включая стратегию и дизайн, отвечали специалисты агентства NEF\TBWA.</p>
<p>В основу концепции дизайна первой коллекции Soligorsk легла многослойность калийной породы как символ города, который некогда был основан в связи с промышленной разработкой калийного месторождения. </p>
<p>В рамках бренда города былналажен выпуск сувенирной продукции, продуктов питания, коллекции одежды под брендом Soligorsk.Команда ZROBYM architects приняла непосредственное участие в разработке выставочных павильонов для реализации промо-продукции. В данный момент три павильона находятся в Минске в фан-зонах IIЕвропейских Игр 2019 возле Минск-Арены, Дворца Спорта и Чижовка-Арены. Ожидается, что после проведения Игр, павильоны будут размещены в знаковых местах города Солигорска.</p>
<p>Для павильона была выбрана простая, чистая, лаконичная форма параллелепипеда. Он имеет двенадцать дверей, которые открыты для всех гостей. Были использованы экологически чистые материалы, павильон решен в натуральных, природных, теплых тонах. В темное время суток используется ленточное освещение, которое формирует светлый, уютный интерьер. Светодиодные ленты, расположенные вертикально на торцах дверей, подчеркивают ритм созданной конструкции и освещают пространство вокруг павильона. </p>
<p>На главном прилавке нанесен логотип города Солигорска, а также волнообразный рисунок горной породы, ожидается, что он появится и на фасаде сооружения. На полу нанесен рисунок из ярких цветных волн, выполненных из мармолеума, которые символизируют слоистость горной породы.</p>
<p>Производством павильонов занималась строительная компания "Современный каркасный дом", курировал строительство Тарнагурский Алексей. </p>`,
