		'Год реализации': 2019,
		'Описание проекта': `<p>Проект кофейни MOBY DICK мы начали в декабре 2018 года. Заказчики пришли к нам со своим собственным взглядом на будущее заведение. Основная идея - это создание пространства с атмосферой квартиры советского профессора, который долго путешествовал по Африке и собрал множество артефактов совершенно противоположной культуры у себя дома. Также была поставлена задача сформировать «немодный» интерьер со своим собственным характером, в обход трендам и со ставкой на индивидуальность. <br />На основе этой идеи было разработано несколько вариантов интерпретации данной концепции, одна из них отразилась в нынешнем интерьере. <br />Материалы отделки, которые мы использовали в интерьере, отсылают нас в эпоху Советского Союза: штучный паркет "ёлочка", классический потолочный карниз, мозаика на полу (как в советских парадных). <br />Почти вся мебель в проекте - итальянской фабрики Calligaris, исключение только саундбар в конце зала от нашего мебельного бренда BYfurniture. Свет от фабрики AROMAS (Испания), &amp;Tradition (Дания) и Centrsvet (Россия). Два настенных бра, которые находятся на простенках между окон, изготовлены специально для этого проекта из керамики (Ceramic MAY). <br />Барная стойка – центральный элемент интерьера и работа стрит-арт художника Жени Cowek. Она выполнена из колотой плитки по нашему эскизу, который Женя в итоге переосмыслил, добавил что-то от себя, но основной мотив африканской растительности в изображении сохранил.</p>`,
