		'Год реализации': 2019,
		'Описание проекта': `<p>Главной концептуальной идеей проекта было сочетание двух понятий: логика и изящность. <br />При разработке планировочного решения, нам было важно сохранить максимальный объем кухни-гостиной, при этом у нас получилась полноценная спальня и детская. В квартире отдельное внимание уделено хранению, есть полноценная гардеробная и постирочная. <br />Весь интерьер выдержан в одной спокойной цветовой гамме, где сочетается простота светлых однотонных поверхностей со сложной фактурой материалов, таких как мрамор, дерево, бетон. Дополняет все это благородный синий цвет в разных своих оттенках. Пространство наполняют жизнью художественные работы, показывая тем самым любовь хозяев к прекрасному. <br />Отдельное внимание уделено свету в квартире. Нам было важно предусмотреть разные сценарии освещения. Свет кроме своего функционального назначения, имеет здесь еще одну функцию – он раскрывает, подчеркивает объемы и материалы интерьера. Некоторые светильники мы разработали специально для этого проекта.</p>`,
