		'Показывать на карте?': 'Да',
		'Год реализации': 2019,
		'Описание проекта': `<p>Проект мы начали делать в октябре 2018 года. Заказчики рассматривают эту квартиру, как место для отдыха, встречи с друзьями. Пространство квартиры должно быть максимально открыто. Кухня не рассчитывалась на ежедневную готовку, так как заказчики часто едят в кафе. Поэтому кухня рассматривалась скорее для приготовления завтраков, это позволило поставить большой обеденный стол и увеличить зону гостиной, в которой должен поместиться диван для большой компании.<br />Визуально интерьер сделан светлым, отделка сцен довольно проста, за исключением градиентной стены рядом с кухней. Весь акцент смещен на функциональные зоны: кухня, обеденная зона, гостиная. Предметы интерьера преимущественно разработала Анна Ляховская, архитектор проекта. Индивидуальность интерьера - это одно из пожеланий заказчика. Спальня так же не имеет сложной отделки, весь акцент смещен на предметы. Основным лейтмотивом интерьера, в эстетическом плане, является фокус на предметах интерьера: мягкая мебель, корпусная мебель. Санузлы решены по одному принципу, при помощи использования одинаковых материалов. Однако хозяйский санузел является скорее местом для отдыха, где установлена джакузи, а зона умывальника является арт-объектом, но при этом несет свою основную функцию.</p>`,
