		'Описание проекта': `<p>Проект интерьера в ЖК «ПИРС» мы начали делать в 2018 году для молодой семейной пары. Основной концепцией интерьера является «проницаемость» пространства, нет ни одного помещения, кроме малого санузла, в которое не попадал бы естественный свет. Так же все зоны плавно перетекают одна в одну. Например, прихожая перетекает в кухню, кухня перетекает в спальню, спальня - в хозяйский санузел. </p>
<p>Одна из особенностей интерьера в том, что в нем практически вся мебель сделана по нашему дизайну, включая мягкую мебель.</p>
<p> Кухня имеет довольно широкий функционал и большое количество хранения, что делает ее не сомасштабной открытому пространству, поэтому мы решили сделать ее максимально закрытой. Кухонный остров имеет небольшую рабочую поверхность, остальная часть острова является обеденным столом. Вся остальная рабочая поверхность кухни скрыта за фасадами белого шкафа, который располагается вдоль стены и поворачивает цельным объемом к входной двери. Таким образом,шкаф для одежды при входе в квартиру перетекает в кухню,формируя единую мебельную конструкцию. Вся конструкция этого белого шкафа (гардеробный шкаф, кухня) оторваны от пола и не доведены до потолка, что создает эффект парения и делает большой объем более легким для визуального восприятия. </p>
<p>В гостиной зоне у нас стандартный набор мебели: диван, кресло, торшер, тумба под телевизором. Так же в зоне гостиной есть проектор и телевизор. </p>
<p>Спальни (детская, хозяйская спальня) отделены от гостиной и кухни стеклянной перегородкой, которую можно закрыть шторой со стороны комнат. При полностью открытых шторах спален мы видим практически все пространство квартиры, это дает больше воздуха и ощущения пространства. </p>
<p>Компоновка хозяйской спальни достаточно нестандартная, при небольших габаритах, у нас была возможность сориентировать кровать в сторону окна, это было сделано по нескольким причинам: просыпаться с видом в окно, отгородиться изголовьем от гостиной и хозяйского санузла и иметь возможность обходить кровать со всех сторон. Розетки и электрика выведены прямо в кровать, а на боковой части кровати, возле изголовья, есть кармашки с выведенными шнурами для зарядки гаджетов. В спальне также есть гардеробный шкаф и туалетный столик, которые переходят в тумбу под умывальники в хозяйском санузле.</p>
<p>Сам хозяйский санузел имеет 2 умывальника, отдельно стоящую ванну и унитаз. Ванна ориентирована в сторону окна спальни, также в хозяйской ванне есть окно под потолком, это окно пропускает естественный свет из кухни.</p>
<p>Отделка всех стен и потолка квартиры сделана штукатуркой типа «шуба». По всей квартире единое напольное покрытие выполнено из плитки, из той плитки же сделан плинтус.</p>`,
